import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import api from '../utils/api';

const colors = {
  darkBlue: '#0D1B2A',
  navy: '#1B263B',
  blueGray: '#415A77',
  lightBlueGray: '#778DA9',
  offWhite: '#E0E1DD',
};

export default function RegisterPage() {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    name: '',
    email: '',
    password: '',
    role: 'resident',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleChange = e => {
    setForm(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    try {
      await api.post('/auth/register', form);
      setSuccess('Registration successful. You can login now.');
      setTimeout(() => navigate('/login'), 2000);
    } catch (err) {
      setError(err.response?.data?.message || 'Registration failed');
    }
  };

  return (
    <div className="d-flex justify-content-center align-items-center vh-100" style={{ backgroundColor: colors.navy }}>
      <form onSubmit={handleSubmit} className="p-4 rounded" style={{ backgroundColor: colors.blueGray, width: '360px' }}>
        <h3 className="text-center mb-4" style={{ color: colors.offWhite }}>Register</h3>
        {error && <div className="alert alert-danger">{error}</div>}
        {success && <div className="alert alert-success">{success}</div>}
        <div className="mb-3">
          <label className="form-label" style={{ color: colors.offWhite }}>Name</label>
          <input type="text" name="name" className="form-control" value={form.name} onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label className="form-label" style={{ color: colors.offWhite }}>Email</label>
          <input type="email" name="email" className="form-control" value={form.email} onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label className="form-label" style={{ color: colors.offWhite }}>Password</label>
          <input type="password" name="password" className="form-control" value={form.password} onChange={handleChange} required />
        </div>
        <div className="mb-3">
          <label className="form-label" style={{ color: colors.offWhite }}>Role</label>
          <select name="role" className="form-select" value={form.role} onChange={handleChange} required>
            <option value="resident">Resident</option>
            <option value="secretary">Secretary</option>
            <option value="treasurer">Treasurer</option>
            <option value="security">Security Guard</option>
            <option value="maintenance">Maintenance Staff</option>
          </select>
        </div>
        <button type="submit" className="btn w-100" style={{ backgroundColor: colors.darkBlue, color: colors.offWhite }}>Register</button>
        <p className="mt-3 text-center" style={{ color: colors.offWhite }}>
          Already have an account? <Link to="/login" style={{ color: colors.offWhite, textDecoration: 'underline' }}>Login</Link>
        </p>
      </form>
    </div>
  );
}
